class Solution {
    func findMaximumNumber(_ k: Int, _ x: Int) -> Int {
        var left = 1
        var right = 2 * k // A safe upper bound guess
        while left < right {
            let mid = (left + right + 1) / 2
            if calculateSum(mid, x) <= k {
                left = mid
            } else {
                right = mid - 1
            }
        }
        return left
    }

    private func calculateSum(_ num: Int, _ x: Int) -> Int {
        var sum = 0
        for i in 1...num {
            sum += countSetBits(i) / x
        }
        return sum
    }

    private func countSetBits(_ num: Int) -> Int {
        var count = 0
        var n = num
        while n > 0 {
            count += n & 1
            n >>= 1
        }
        return count
    }
}
